// inpage_notification
const lf_inpage_notification = document.getElementById("lf_inpage_notification");
let lf_inpage_notification_status = 0;
let current_width = 0;
var inpage_notif_inter_setting;
function inpage_notification(long, txt) {
    lf_inpage_notification_status=1;
    document.querySelector("#lf_inpage_notification div").innerHTML = txt;
    lf_inpage_notification.style.transform = "translateX(0vw)";
    inpage_notif_inter_setting = setInterval(()=>{
        if(lf_inpage_notification_status == 1) {
            document.querySelector("#lf_inpage_notification span").style.maxWidth = (current_width*100/long)+"%";
            current_width += (long/100);
            if(current_width >= (long+(long/100))) {
                lf_inpage_notification.style.transform = "translateX(-80vw)";
                lf_inpage_notification_status=0;
                current_width = 0;
                document.querySelector("#lf_inpage_notification span").style.maxWidth = 0+"%";
                clearInterval(inpage_notif_inter_setting);
            }
        }
    }, (long/100));
}
document.querySelector("#lf_inpage_notification svg").addEventListener("click", ()=>{
    lf_inpage_notification.style.transform = "translateX(-80vw)";
    lf_inpage_notification_status=0;
    current_width = 0;
    document.querySelector("#lf_inpage_notification span").style.maxWidth = 0+"%";
    clearInterval(inpage_notif_inter_setting);
});





